import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import Homepage from "./components/HomePage/Homepage";
import AddItem from "./components/AddPostPage/AddItem";
import Login from "./components/LoginPage/Login";
import Signup from "./components/SignupPage/Signup";
import { Route, Routes, BrowserRouter } from "react-router-dom";
import reportWebVitals from "./reportWebVitals";
import Navbar from "./components/Navbar/Navbar";
import Profile from "./components/ProfilePage/Profile";
import Messages from "./components/MessagePage/Messages";
import Inbox from "./components/InboxPage/Inbox";
import AdminProfile from "./components/AdminProfile/AdminProfile";
import PrivateRoute from './PrivateRoute';

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <PrivateRoute path="/Signup" component={<Signup />} />
        <PrivateRoute path="/AddItem" component={<AddItem />} />
        <PrivateRoute path="/Home" component={<Homepage />} />
        <PrivateRoute path="/Nav" component={<Navbar />} />
        <PrivateRoute path="/Profile" component={<Profile />} />
        <PrivateRoute path="/Messages" component={<Messages />} />
        <PrivateRoute path="/Inbox" component={<Inbox />} />
        <PrivateRoute path="/Admin" component={<AdminProfile />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

reportWebVitals();
